import React from 'react';

import { StyledIdentification, Description, Text } from './styles';


const Identification = () => {
  return (

    <StyledIdentification>

      <Description>
        <Text>For you playing game,
        first identify yourself </Text>
      </Description>

    </StyledIdentification>
  );
};



export default Identification;
